import { Link } from 'react-router-dom'; // Asegúrate de importar esto

export default function Login() {
  return (
    <div style={{ padding: '1rem' }}>
      <h2>Redireccionar al Dashboard</h2>
      <Link to="/Dashboard">
        <button style={{ padding: '0.5rem 1rem', fontSize: '1rem' }}>
          Ir al Dashboard
        </button>
      </Link>
    </div>
  );
}
